function findMinMax() {
        array = [50, 60, 20, 10, 40];
        minValue = Infinity;
        maxValue = -Infinity;
      
        for (item of array) {
            // find minimum value
            if (item < minValue)
                minValue = item;
      
            // find maximum value
            if (item > maxValue)
                maxValue = item;
        }
      }
